using leetcodesln;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace leetcodesln_test
{
    [TestClass]
    public class FindAllAnagramsInAStringUnitTest
    {
        public FindAllAnagramsInAString FindAllAnagramsInAString { get; set; }

        [TestInitialize]
        public void BeforeEach()
        {
            FindAllAnagramsInAString = new FindAllAnagramsInAString();
        }

        [TestMethod, Timeout(20_000)]
        public void TestMethod1()
        {
            var s = "cbaebabacd";
            var p = "abc";
            var expected = new int[] { 0, 6 };
            var actual = FindAllAnagramsInAString.FindAnagramsTwoPointerSlidingWindow(s, p);
            for (int i = 0; i < expected.Length; i++)
            {
                Assert.AreEqual(expected[i], actual[i]);
            }
        }

        [TestMethod, Timeout(20_000)]
        public void TestMethod2()
        {
            var s = "abab";
            var p = "ab";
            var expected = new int[] { 0, 1, 2 };
            var actual = FindAllAnagramsInAString.FindAnagrams(s, p);
            for (int i = 0; i < expected.Length; i++)
            {
                Assert.AreEqual(expected[i], actual[i]);
            }
        }

        [TestMethod, Timeout(20_000)]
        public void TestMethod3()
        {
            var s = "";
            var p = "abc";
            var expected = new int[] { };
            var actual = FindAllAnagramsInAString.FindAnagrams(s, p);
            for (int i = 0; i < expected.Length; i++)
            {
                Assert.AreEqual(expected[i], actual[i]);
            }
        }

        [TestMethod, Timeout(20_000)]
        public void TestMethod4()
        {
            var s = "";
            var p = "";
            var expected = new int[] { };
            var actual = FindAllAnagramsInAString.FindAnagrams(s, p);
            for (int i = 0; i < expected.Length; i++)
            {
                Assert.AreEqual(expected[i], actual[i]);
            }
        }
    }
}
